import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider, useAuth } from './context/AuthContext';
import { TranslationProvider } from './context/TranslationContext';
import Navbar from './components/common/Navbar'; // Updated path
import Footer from './components/Footer';
import Home from './pages/Home';
import Books from './pages/Books';
import BookDetail from './pages/BookDetail';
import Cart from './pages/Cart';
import Checkout from './pages/Checkout';
import Login from './pages/Login';
import Register from './pages/Register';
import ForgotPassword from './pages/ForgotPassword';
import Profile from './pages/Profile';
import AdminDashboard from './pages/AdminDashboard';
import EmployeeDashboard from './pages/EmployeeDashboard';
import AdminBookManager from './components/admin/BookManager'; // Renamed for clarity
import AdminUserManager from './components/admin/UserManager'; // Renamed for clarity
import EmployeeManager from './components/admin/EmployeeManager';
import EmployeeBookManager from './components/employee/BookManager'; // Employee version
import EmployeeUserManager from './components/employee/UserManager'; // Employee version
import OrderManager from './components/employee/OrderManager';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import io from 'socket.io-client';

const socket = io('http://localhost:5000');

function App() {
  const [cartItems, setCartItems] = useState(() => {
    const savedCart = localStorage.getItem('cartItems');
    return savedCart ? JSON.parse(savedCart) : [];
  });

  const { user } = useAuth();

  useEffect(() => {
    localStorage.setItem('cartItems', JSON.stringify(cartItems));
  }, [cartItems]);

  useEffect(() => {
    socket.on('notification', (notification) => {
      if (user && notification.userId === user.id) {
        toast.success(notification.message, {
          position: 'top-right',
          autoClose: 5000,
        });
      }
    });

    return () => {
      socket.off('notification');
    };
  }, [user]);

  return (
    <AuthProvider>
      <TranslationProvider>
        <Router>
          <div className="app">
            <Navbar cartItems={cartItems} setCartItems={setCartItems} />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/books" element={<Books cartItems={cartItems} setCartItems={setCartItems} />} />
              <Route path="/books/:id" element={<BookDetail cartItems={cartItems} setCartItems={setCartItems} />} />
              <Route path="/cart" element={<Cart cartItems={cartItems} setCartItems={setCartItems} />} />
              <Route path="/checkout" element={<Checkout setCartItems={setCartItems} />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/forgot-password" element={<ForgotPassword />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/admin" element={<AdminDashboard />}>
                <Route path="books" element={<AdminBookManager />} />
                <Route path="users" element={<AdminUserManager />} />
                <Route path="employees" element={<EmployeeManager />} />
              </Route>
              <Route path="/employee" element={<EmployeeDashboard />}>
                <Route path="orders" element={<OrderManager />} />
                <Route path="books" element={<EmployeeBookManager />} />
                <Route path="users" element={<EmployeeUserManager />} />
              </Route>
            </Routes>
            <Footer />
            <ToastContainer position="top-right" autoClose={5000} />
          </div>
        </Router>
      </TranslationProvider>
    </AuthProvider>
  );
}

export default App;
